pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import '@openzeppelin/contracts/access/Ownable.sol';
import '@openzeppelin/contracts/security/ReentrancyGuard.sol';
import 'base64-sol/base64.sol';
import 'hardhat/console.sol';

contract NFTG is ERC721URIStorage, ReentrancyGuard, Ownable {
  constructor() ERC721('NFT-Game', 'NFTG') Ownable() {}

  uint256 public tokenCount = 0;
  uint256 public tokenId = 0;
  uint256 public maxTokens = 10000;
  uint256 public maxPlayers = 10;

  mapping(uint256 => address) tokenIdMinter;
  mapping(uint256 => uint256) tokenIdTransfers;
//   mapping(uint256 => uint256) tokenIdRandom;
  // mapping(uint256 => address) tokenIdWinner;
  // mapping(address => bool) beenTransferred;


  function withdrawAll() public onlyOwner {
    require(payable(msg.sender).send(address(this).balance));
  }

  function mintNFT() public payable {
    require(tokenCount < maxTokens, 'ALL TOKENS MINTED');
    tokenCount += 1;
    tokenId = tokenCount;
    _safeMint(msg.sender, tokenId);
    tokenIdTransfers[tokenId] = 0;
    tokenIdMinter[tokenId] = msg.sender;
    string memory SVG = svg(tokenId);
    string memory imageURI = svgToImageURI(SVG);
    string memory tokenURI = formatTokenURI(imageURI);
    _setTokenURI(tokenId,tokenURI);
  }

  function transferNFT(address friend, uint256 _tokenId) public {
    require(msg.sender != friend, 'cannot gift to yourself');
    // require(beenGifted[friend] == false, 'first transfer');
    // beenTransferred[friend] = true;
    _transfer(msg.sender, friend, _tokenId);
    tokenIdTransfers[_tokenId] = tokenIdTransfers[_tokenId] + 1;
    string memory SVG = svg(tokenId);
    string memory imageURI = svgToImageURI(SVG);
    string memory tokenURI = formatTokenURI(imageURI);
    _setTokenURI(tokenId,tokenURI);
  }

  function getTokenIdMinter(uint256 _tokenId) public view returns (address) {
    return tokenIdMinter[_tokenId];
  }

  function getTokenIdTransfers(uint256 _tokenId) public view returns (uint256) {
    return tokenIdTransfers[_tokenId];
  }

  function svg(uint256 _tokenId) public view returns (string memory) {
     string memory svg1 = string(abi.encodePacked('<svg width="500" height="500">',
     '<rect width="500" height="500" style="fill:black;stroke:pink;stroke-width:10;fill-opacity:1;stroke-opacity:1" />',
     '<text x="50%" y="20%" style="fill:white;dominant-baseline="middle" text-anchor="middle"">Token Id = ', uint2str(_tokenId),
     '<tspan x="50%" y="40%">', (tokenIdMinter[_tokenId]), ' Minted The NFT</tspan>',
     '<tspan x="50%" y="60%">Transfers Done = ', uint2str(tokenIdTransfers[_tokenId]),'</tspan>', 
     '<tspan x="50%" y="80%" >Current Owner =', ownerOf(_tokenId), '</tspan></text></svg>'));
     return svg1;
  }

  function svgToImageURI(string memory _svg) public pure returns (string memory) {
      string memory baseURL = "data:image/svg+xml;base64,";
       string memory svgBase64Encoded = Base64.encode(bytes(string(abi.encodePacked(_svg))));
       return string(abi.encodePacked(baseURL,svgBase64Encoded));
  }

  function formatTokenURI(string memory _imageURI) public pure returns (string memory) {
      return string(
              abi.encodePacked(
                  "data:application/json;base64,",
                  Base64.encode(
                      bytes(
                          abi.encodePacked(
                              '{"name":"',
                              "NFT Game", // You can add whatever name here
                              '", "description":"An dynamic NFT game which is purely on-chain", "attributes":"", "image":"',_imageURI,'"}'
                          )
                      )
                  )
              )
          );
  }

// From: https://stackoverflow.com/a/65707309/11969592
  function uint2str(uint _i) internal pure returns (string memory _uintAsString) {
      if (_i == 0) {
          return "0";
      }
      uint j = _i;
      uint len;
      while (j != 0) {
          len++;
          j /= 10;
      }
      bytes memory bstr = new bytes(len);
      uint k = len;
      while (_i != 0) {
          k = k-1;
          uint8 temp = (48 + uint8(_i - _i / 10 * 10));
          bytes1 b1 = bytes1(temp);
          bstr[k] = b1;
          _i /= 10;
      }
      return string(bstr);
  }

